import React from 'react'

import './InputPrompt.scss'

export default class InputPrompt extends React.Component {
    constructor(props) {
        super(props);
        
        this.value = null;

        this.state = {
            operation: this.props.operation
        }
    }

    updateInputValue() {

    }

    confirm() {
        document.getElementById('')
    }

    cancel() {

    }

    render() {
        return (
            <>
                <div id='prompt-container'>

                    <div id='input-container'>
                        <div id='input-message'>Please select element to { this.state.operation.toLowerCase() }</div>
                        <input id='input-number' onChange={this.updateInputValue} type='number' step='1' />
                        <button id='input-confirm' className='input-prompt-button'>{ this.state.operation }</button>
                        <button id='input-cancel' className='input-prompt-button'>Cancel</button>
                    </div>

                    <div id='prompt-background' />

                </div>
            </>
        );
    }
}
